    - ID: "30b0a514-dc94-432c-9655-8c01e474023f"
      Hint: ExtendedContent
      Value: "<p>Prevent adult mosquito emergence, including those which may transmit vector-borne diseases like West Nile virus, Zika virus, Chikungunya and dengue. Altosid® SR-20 Liquid Larvicide is an effective and flexible formulation fitting for any mosquito-control program. </p> <p>Altosid® SR-20 Liquid Larvicide Concentrate offers superior control in a wide range of habitats and application areas, including temporary or floodwater breeding areas and irrigated cropland. Providing labor savings with residual control, this formulation is approved for aerial and ground ULV treatments. </p> <h4>FEATURES: </h4> <ul> <li>Kills most mosquito pest species</li> <li>Consistent results in all population densities </li> <li> No impact on food web </li> <li>The active ingredient US produced (S)-methoprene</li> </ul>"
